import React, { useState } from "react";

let places = [
  { name: "Palo Alto", zip: "94303" },
  { name: "San Jose", zip: "94088" },
  { name: "Santa Cruz", zip: "95062" },
  { name: "Honolulu", zip: "96803" },
  { name: "Kiev", zip: "703448" },
];

const Places = (props) => {
  console.log(props.place.place);
  console.log(props.place.zip);
  console.log(props.place);

  return (
    <div>
      <p>дочерний элемент = {props.place.place}</p>
      <p>дочерний элемент zip = {props.place.zip}</p>
      {places.map((place, index) => {
        return (
          <div>
            <button
              key={index}
              onClick={() => {
                props.place.newPlace(place.name);
                props.place.newPlace(place.zip);

                console.log(props);
              }}
            >
              {place.name}
            </button>
          </div>
        );
      })}
    </div>
  );
};

export default Places;
